import {  BrowserRouter, Routes, Route} from "react-router-dom";
import {Home} from './pages/Home.jsx';
import {User} from './pages/User.jsx';
import {NewsletterList} from './pages/NewsletterList.jsx';
import {AddNewsletter} from './pages/AddNewsletter.jsx';
import {NewsletterType} from './pages/NewsletterType.jsx';
import Axios from 'axios';

Axios.interceptors.request.use(function(config){
  config.url = `${process.env.REACT_APP_API_BASE_URL}${config.url}`
})
function App() {
  return (    
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/home" element={<Home />} />
      <Route path="/user" element={ <User/> } />
      <Route path="/newsletterList" element={<NewsletterList />} />
      <Route path="/newsletter" element={<AddNewsletter />} />
      <Route path="/newsletterType" element={<NewsletterType />} />
    </Routes>
  </BrowserRouter>     

  );
}

export default App;
